import { get } from 'lodash'

export default async function colors (file) {
  console.log('import fonts...')
  const res = {}
  const styles = get(file, 'styles', {})
  const textKeys = Object.keys(styles).filter(key => get(styles, `${key}.styleType`) === 'TEXT')

